`,s.jsx(e.p,{children:"This version includes some big visual and gameplay improvements for certain levels."}),`
`,s.jsxs(e.ul,{children:[`
`,s.jsxs(e.li,{children:["Improved visual style for the server room on Moonbase Alpha (i.e. the final level",s.jsx(e.br,{}),`
